import * as React from 'react';
import { useEffect } from 'react';
import AppBar from '@mui/material/AppBar';
import Box from '@mui/material/Box';
import Toolbar from '@mui/material/Toolbar';
import Typography from '@mui/material/Typography';
import Button from '@mui/material/Button';
import { Link } from "react-router-dom";
import axios from 'axios';

const url = "http://localhost:5000";



export default function ButtonAppBar(props) {

  useEffect( () => {

  }, [props])

  const logout = (e) => {
    axios.delete(`${url}/delete`, {withCredentials: true}).then(
      res => {
        if(res.status >= 200 && res.status <= 299) {
          console.log("logged out");
        }
      }
    ).catch((error) => {
      // setError("error logging out");
      console.log(error);
    });
  }

  return (
    <Box sx={{ flexGrow: 1 }}>
      <AppBar position="static" sx={{backgroundColor: "white"}}>
        <Toolbar>
          {/* <IconButton
            size="large"
            edge="start"
            color="inherit"
            aria-label="menu"
            sx={{ mr: 2 }}
          >
            <MenuIcon />
          </IconButton> */}
          <Typography variant="h6" component="div" sx={{ flexGrow: 1, color: "black"}}>
            Task Tracker
          </Typography>

          <Button color="inherit" onClick={logout} sx={{textDecoration: 'none', color: "black"}}>Log out</Button>

          <Link sx={{textDecoration: 'none'}} to={"/login"}> 
            <Button color="inherit" sx={{textDecoration: 'none', color: "black"}}>Login</Button>
          </Link>

        </Toolbar>
      </AppBar>
    </Box>
  );
}
